[js:core] fix #2660 add `requestError` event and make error message controlable

For example, Auto redirect if connector return redirection

```javascript
handlers : {
    requestError: function(e, fm) {
        var data = e.data,
            err = data.err || '',
            myurl = fm.convAbsUrl(data.cmd === 'upload'? fm.uploadURL :
fm.options.url),
            defloc = 'https://hypweb.net/elFinder-nightly/demo/',
            loc;
        if (data.xhr) {
            // for the modern browser
            if (typeof data.xhr.responseURL !== 'undefined') {
                if (data.xhr.responseURL &&
data.xhr.responseURL.indexOf(myurl) !== 0) {
                    loc = data.xhr.responseURL;
                }
            // for the legacy browser (e.g IE)
            } else if (err.error === 'errDataNotJSON' ||
(Array.isArray(err.error) && $.inArray('errDataNotJSON', err.error) !==
-1)) {
                loc = defloc;
            }
        }
        if (loc) {
            // prevent showing error messages
            e.preventDefault();
            window.location = loc;
        }
    }
}
```

[VD:LocalFileSystem] add an option `statCorrector` to correct stat data

Example for 32bit PHP on armv7l GNU/Linux see #2613

```php
array (
    'driver'        => 'LocalFileSystem',
    'path'          => '/path/to/files/',
    'statCorrector' => function (&$stat, $path, $statOwner,
$volumeDriveInstance) {
        if (isset($stat['size']) && $stat['mime'] !== 'directory') {
            if ($stat['size'] == '0') {
                // filesize problem for file larger than 4GB ( testing
                // in PHP Version 5.4.16)
                // https://stackoverflow.com/questions/6482211/php-filesize-over-4gb
                $stat['size'] = trim(shell_exec('stat -c %s
'.escapeshellarg($path)));
            }

            if ($stat['ts'] === false){
                // sometime filemtime will failed to return false
                $stat['ts'] = (int)trim(shell_exec('stat -c %Y
'.escapeshellarg($path)));
            }
        }
    }
)
```

