[ui:dialog] fix #2551 trigger `dialogopen` event before open the dialog

Example: Make the edit dialog the same size as the elFinder node

To define with `handlers.dialogopen: [Fn]` of the client setting or `elFinderInstance.bind('dialogopen', [Fn])`.

```javascript
handlers : {
    dialogopen : function(e, fm) {
        var dialog = e.data.dialog,
            elfNode;
        if (dialog.hasClass('elfinder-dialog-edit')) {
            elfNode = fm.getUI();
            dialog.css({
                top: 0,
                left: 0,
                width: elfNode.width(),
                height: elfNode.height()
            }).trigger('resize', { init : true });
        }
    }
}
```

[cmd:rm] fix #2541 to be able to customize the action of to put in the trash

How to make customized trash function
=====================================

Connector Side
--------------

Set to use extended commands. `rm` to `myRm` in the file volume and
`copy` to `myRestore` in the trash volume.

- File Volume option
```php
'uiCmdMap' => array('rm' => 'myRm'),
```
- Trash Volume option
```php
'uiCmdMap' => array('paste' => 'hidden', 'mkdir' => 'hidden', 'copy' =>
'myRestore'),
```

Client Side
-----------

Make extended commands.

```javascript
// myRm
(elFinder.prototype.commands.myRm = function() {
    var self = this,
        fm = this.fm;

    // see
    // https://github.com/Studio-42/elFinder/blob/master/js/commands/rm.js
    this.toTrash = function(dfrd, targets, tHash) {
        // your customized function
        fm.unlockfiles({files : targets});
        dfrd.reject('my toTrash test');
    };
}).prototype = {
     forceLoad : true,
     extendsCmd : 'rm'
};

// myRestore
(elFinder.prototype.commands.myRestore = function() {
    var self = this,
        fm = this.fm;

    // see
    // https://github.com/Studio-42/elFinder/blob/master/js/commands/restore.js
    this.restore = function(dfrd, files, targets, ops) {
        // your customized function
        dfrd.reject('my restore test');
    };
}).prototype = {
     forceLoad : true,
     extendsCmd : 'restore'
};
```

