```php
<?php

$opts = array(
    'sessionCacheKey' => 'MY-elFinderCaches', // default value is "elFinderCaches"
    'roots'  => array(
        array(
            'driver' => 'LocalFileSystem',
            'path'   => '/path/to/files/',
            'URL'    => 'http://localhost/to/files/'
        )
    )
);

// run elFinder
$connector = new elFinderConnector(new elFinder($opts));
$connector->run();
```

