[connector] add hook point `*.pre`(cmd preprocessing) for bind

call bind callback function with ($cmd, &$args, $this, $volume)
on preprocessing exec any command.

ex.
```php
$opts = array(
	'bind' => array(
		'*.pre' => 'preprocessing'
	),
	'roots' => array(...)
);
function preprocessing($cmd, &$args, $this, $volume) {
	// You can change value of `$args`
	// Then, `cmd` is performed using changed $args.
}

[plugin:AutoResize] add new plugin "AutoResize"

# Connector configuration options

```php
$opts = array(
	'roots'	 => array(
		 array(
			'driver' => 'LocalFileSystem',
			'path'	 => '/path/to/files/',
			'URL'	 => 'http://localhost/to/files/',
			'plugin' => array(
				/* optional, this volume values are */
				'AutoResize' => array(
					'enable'		 => true,		// For control by volume driver
					'maxWidth'		 => 1024,		// Path to Water mark image
					'maxHeight'		 => 1024,		// Margin right pixel
					'quality'		 => 95,			// JPEG image save quality
					'targetType'	 => IMG_GIF|IMG_JPG|IMG_PNG|IMG_WBMP
											   // Target image formats ( bit-field )
				),
			),
	),
	'bind'	 => array(
		/* regist action, require */
		'upload.presave' => array(
			'Plugin.AutoResize.onUpLoadPreSave'
		),
	),
	'plugin' => array(
		/* optional, All volume's default values are */
		'AutoResize' => array(
			'enable'		 => true,		// For control by volume driver
			'maxWidth'		 => 1024,		// Path to Water mark image
			'maxHeight'		 => 1024,		// Margin right pixel
			'quality'		 => 95,			// JPEG image save quality
			'targetType'	 => IMG_GIF|IMG_JPG|IMG_PNG|IMG_WBMP
									   // Target image formats ( bit-field )
		),
	),
);
$connector = new elFinderConnector(new xelFinder($opts), true);
$connector->run();
```

# Connector configuration options(enable AutoResize & Watermark with default)

```php
$opts = array(
	'roots'	 => array(
		 array(
			'driver' => 'LocalFileSystem',
			'path'	 => '/path/to/files/',
			'URL'	 => 'http://localhost/to/files/',
	),
	'bind'	 => array(
		/* regist action, require */
		'upload.presave' => array(
			'Plugin.AutoResize.onUpLoadPreSave', // Do 1st
			'Plugin.Watermark.onUpLoadPreSave'   // Do 2nd
		),
	),
);
$connector = new elFinderConnector(new xelFinder($opts), true);
$connector->run();
```

